import React from "react";
import styled from "styled-components";
import { Button } from "react-bootstrap";

const StyledDiv = styled.div`
  background-color: #ffffff;
  width: auto;
  height: 100px;
  text-align: center;
  padding-top: 1rem;
`;

const Footer = (props) => {
  return <StyledDiv />;
};

export default Footer;
